   [[The single panel depicts page 1 of 18 of a (guitar?) tab, and a ``scholars note for the music, over a background image of a flowering vine growing outside a window.]] / Tab heading: Sheet music for ``Sullivans Bear and Dried Bird ca. 1901 / Playing notes: Standard Tuning, p=pull off, h=hammer on, Intro: Andante, Legato. / Verse 1 [begins]: I strayed on down an alley-way, the name I did not know -- the window dressing caught my ... / Verse 2 [begins]: The soldiers numbered twenty-four, the mallard plainly saw.  The bear, he had no time for ... / Verse 3 [begins]: ``Theyre mocking me and dancing, when Im not around.  That much I am sure of, as sure as ... / Scholars note.: The subject of this song is a child who stands for hours every day in front of a mysterious shop (``Sullivans) which never openss.  Through the bars on the windows he can see dusty shelves and glass cabinets filled with a variety of dimly lit curios.  Among them he enumerates sets of asian jars, baby animals in ether, intricately detailed models of wooden sailing ships, obscure cookware, stringed instruments, tin soldiers, sagging leatherbound volumes, and great containers of multicolred candies.  However, the objects which hold the most fascination for him are a life-size stuffed bear and mallar. / The child stares at them incessantly, sure that if his attention is directed toward them long enough they will come to show signs of life.  Season after season, year after year, in full summer sun and driving snow, the boy steals away from his chores to come look in the window.  He stands motionless, intent, looking into the dim glow of the locked shop on the ever-deserted alleyway, peering unceasingly into the eyes of the bear and bird.  Never moving, never changing, they perpetually stare into the distance.  Eventually the child goes insane. / ``Sullivans Bear and Dried Bird stands alone in its vivid depiction of the effects a prolonged exposure to achewater can have on the central nervous system. While the identity of the author remains a subject of some contention, lines like ``staring past the orange brocade/the brain in lively marinade and ``still water fooled the lonely duck/the beak sucked in the devils muck hint that the slave liquor had made its way into a more literate circle of society and may well have been penned by an aristocratic addict. / -- Joel Steinmetz / Boston, MA 1975 / {{Tooltip: Merry Christmas, a page from the aborted Volume I project}}
